class EmptyCart extends React.Component {
    render() {
        return (
            <div className='container mt-5'>
                <div className='row'>
                    <div className='col-10 mx-auto text-center text-title'>
                        <h4 className='title-cart'>Your cart is currentle empty</h4>
                    </div>
                </div>
            </div>
        )
    }
}

export default EmptyCart;
